import React from 'react';
import './index.css';
import { Link, animateScroll as scroll } from 'react-scroll';

export default function Home() {
    return (
        <div>
            <div style={{
                boxSizing: 'border-box',
                margin: '0',
                padding: '0',
                zIndex: '999',
                width: '100%',
                height: '100vh',
                display: 'flex',
                gridTemplateColumns: 'repeat(3, 1fr)',
                gridTemplateRows: 'repeat(3, 1fr)',
                gridGap: '10px',
                justifyContent: 'center',
                alignItems: 'center',
                borderBottom: '100px solid white'
            }
            }>
                <div style={{
                    display: 'flex',
                    position: 'relative',
                    fontSize: '40px',
                    fontWeight: 'bold',
                    justifyContent: 'center',
                    alignItems: 'center'
                }}><h1>TAYLER RADCLIFFE</h1>
                    <h5 style={{ display: 'flex', position: 'absolute', marginTop: '250px' }}>Software Developer</h5>
                </div>

                <div class="container" style={{
                    position: 'absolute',
                    fontSize: '60px',
                    marginTop: '600px'
                }}>
                    <div class="arrow" onClick={scroll.scrollToBottom()}>
                    </div>

                </div>
            </div>
        </div>

    )
}
